INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (81, N'Roman J. Israel, Esq.', N'Hard-nosed liberal lawyer Roman J. Israel has been fighting the good fight forever while others take the credit. When his partner, the firm’s frontman, has a heart attack, Israel suddenly takes on that role. He soon discovers some unsettling truths about the firm--truths that conflict with his values of helping the poor and dispossessed--and finds himself in an existential crisis that leads to extreme actions.', CAST(N'2017-11-10' AS Date), 129, 413362, N'tt6000478', N'/8e5IGlLrVjwrlDcRtzSQkXhJFWl.jpg', N'/zms098KnZ30YfV9K0FaeiCUGuQ6.jpg', CAST(N'2017-11-09T23:41:01.123' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (82, N'The Carmilla Movie', N'It has been five years since Laura and Carmilla vanquished the apocalypse and Carmilla became a bonafide mortal human. They have settled in to a cozy apartment in downtown Toronto, Laura continues to hone her journalism skills while Carmilla adjusts to a non-vampire lifestyle. Their domestic bliss is suddenly ruptured when Carmilla begins to show signs of "re-vamping" – from a fondness for bloody treats to accidental biting – while Laura has started having bizarre, ghostly dreams. The couple must now enlist their old friends from Silas University to uncover the unknown supernatural threat and save humanity – including Carmilla''s.', CAST(N'2017-10-26' AS Date), 94, 421131, N'tt7427856', N'/sSQlCNbF43nkOnuFsXhDq08Tw0c.jpg', N'/AjWSgCRy7FQeViVHiN0jPZWU9Ur.jpg', CAST(N'2017-11-09T23:41:01.490' AS DateTime))
