INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (109, N'The Shawshank Redemption', N'Framed in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.', CAST(N'1994-09-23' AS Date), 142, 278, N'tt0111161', N'/9O7gLzmreU0nGkIB6K3BsJbzvNv.jpg', N'/xBKGJQsAIeweesB79KC89FpBrVr.jpg', CAST(N'2017-11-09T23:41:17.103' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (110, N'The Dark Knight', N'Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.', CAST(N'2008-07-16' AS Date), 152, 155, N'tt0468569', N'/1hRoyzDtpgMU7Dz4JF22RANzQO7.jpg', N'/hqkIcbrOHL86UncnHIsHVcVmzue.jpg', CAST(N'2017-11-09T23:41:17.483' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (111, N'The Dark Knight Rises', N'Following the death of District Attorney Harvey Dent, Batman assumes responsibility for Dent''s crimes to protect the late attorney''s reputation and is subsequently hunted by the Gotham City Police Department. Eight years later, Batman encounters the mysterious Selina Kyle and the villainous Bane, a new terrorist leader who overwhelms Gotham''s finest. The Dark Knight resurfaces to protect a city that has branded him an enemy.', CAST(N'2012-07-16' AS Date), 165, 49026, N'tt1345836', N'/dEYnvnUfXrqvqeRSqvIEtmzhoA8.jpg', N'/3bgtUfKQKNi3nJsAB5URpP2wdRt.jpg', CAST(N'2017-11-09T23:41:17.823' AS DateTime))
