INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (122, N'Dilwale Dulhania Le Jayenge', N'Raj is a rich, carefree, happy-go-lucky second generation NRI. Simran is the daughter of Chaudhary Baldev Singh, who in spite of being an NRI is very strict about adherence to Indian values. Simran has left for India to be married to her childhood fiancé. Raj leaves for India with a mission at his hands, to claim his lady love under the noses of her whole family. Thus begins a saga.', CAST(N'1995-10-20' AS Date), 190, 19404, N'tt0112870', N'/2gvbZMtV1Zsl7FedJa5ysbpBx2G.jpg', N'/nl79FQ8xWZkhL3rDr1v2RFFR6J0.jpg', CAST(N'2017-11-09T23:41:24.650' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (123, N'Jurassic World', N'Twenty-two years after the events of Jurassic Park, Isla Nublar now features a fully functioning dinosaur theme park, Jurassic World, as originally envisioned by John Hammond.', CAST(N'2015-06-09' AS Date), 124, 135397, N'tt0369610', N'/jjBgi2r5cRt36xF6iNUEhzscEcb.jpg', N'/dkMD5qlogeRMiEixC4YNPUvax2T.jpg', CAST(N'2017-11-09T23:41:25.013' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (124, N'Jurassic Park', N'A wealthy entrepreneur secretly creates a theme park featuring living dinosaurs drawn from prehistoric DNA. Before opening day, he invites a team of experts and his two eager grandchildren to experience the park and help calm anxious investors. However, the park is anything but amusing as the security systems go off-line and the dinosaurs escape.', CAST(N'1993-06-11' AS Date), 127, 329, N'tt0107290', N'/c414cDeQ9b6qLPLeKmiJuLDUREJ.jpg', N'/iYVNXCMUYDIW5CfI2wf9ocIzouP.jpg', CAST(N'2017-11-09T23:41:25.313' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (125, N'The Lost World: Jurassic Park', N'Four years after Jurassic Park''s genetically bred dinosaurs ran amok, multimillionaire John Hammond shocks chaos theorist Ian Malcolm by revealing that Hammond has been breeding more beasties at a secret location. Malcolm, his paleontologist ladylove and a wildlife videographer join an expedition to document the lethal lizards'' natural behavior in this action-packed thriller.', CAST(N'1997-05-23' AS Date), 129, 330, N'tt0119567', N'/u1fXmEQUCI9CjyHCCYOPBSq2DYo.jpg', N'/6KOPTlgmEb6MkKYTcDA1QAN6vGJ.jpg', CAST(N'2017-11-09T23:41:25.873' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (126, N'Jurassic Park III', N'In need of funds for research, Dr. Alan Grant accepts a large sum of money to accompany Paul and Amanda Kirby on an aerial tour of the infamous Isla Sorna. It isn''t long before all hell breaks loose and the stranded wayfarers must fight for survival as a host of new -- and even more deadly -- dinosaurs try to make snacks of them.', CAST(N'2001-07-18' AS Date), 92, 331, N'tt0163025', N'/26L7XODsNlxX3VwkfuUnYOslbRF.jpg', N'/jNUEjodQaJ6HcAXbaB9gOFVcQOC.jpg', CAST(N'2017-11-09T23:41:26.470' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (127, N'Jurassic World: Fallen Kingdom', N'With all of the wonder, adventure and thrills synonymous with one of the most popular and successful franchises in cinema history, this all-new motion-picture event sees the return of favorite characters and dinosaurs along with new breeds more awe-inspiring and terrifying than ever before.', CAST(N'2018-06-01' AS Date), 0, 351286, N'tt4881806', N'/ln6d5Okr6VK5vfQVobJTiYxeD0l.jpg', N'/kq23EdE5nUyOsfxnGYDGsAqsl7n.jpg', CAST(N'2017-11-09T23:41:27.033' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (128, N'Terminator Genisys', N'The year is 2029. John Connor, leader of the resistance continues the war against the machines. At the Los Angeles offensive, John''s fears of the unknown future begin to emerge when TECOM spies reveal a new plot by SkyNet that will attack him from both fronts; past and future, and will ultimately change warfare forever.', CAST(N'2015-06-23' AS Date), 126, 87101, N'tt1340138', N'/5JU9ytZJyR3zmClGmVm9q4Geqbd.jpg', N'/bIlYH4l2AyYvEysmS2AOfjO7Dn8.jpg', CAST(N'2017-11-09T23:41:28.033' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (129, N'The Terminator', N'In the post-apocalyptic future, reigning tyrannical supercomputers teleport a cyborg assassin known as the "Terminator" back to 1984 to kill Sarah Connor, whose unborn son is destined to lead insurgents against 21st century mechanical hegemony. Meanwhile, the human-resistance movement dispatches a lone warrior to safeguard Sarah. Can he stop the virtually indestructible killing machine?', CAST(N'1984-10-26' AS Date), 108, 218, N'tt0088247', N'/q8ffBuxQlYOHrvPniLgCbmKK4Lv.jpg', N'/6yFoLNQgFdVbA8TZMdfgVpszOla.jpg', CAST(N'2017-11-09T23:41:28.340' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (130, N'Terminator 2: Judgment Day', N'Nearly 10 years have passed since Sarah Connor was targeted for termination by a cyborg from the future. Now her son, John, the future leader of the resistance, is the target for a newer, more deadly terminator. Once again, the resistance has managed to send a protector back to attempt to save John and his mother Sarah.', CAST(N'1991-07-01' AS Date), 137, 280, N'tt0103064', N'/2y4dmgWYRMYXdD1UyJVcn2HSd1D.jpg', N'/d9AqtruwS8nljKjL5aYzM42hQJr.jpg', CAST(N'2017-11-09T23:41:28.950' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (131, N'Terminator 3: Rise of the Machines', N'It''s been 10 years since John Connor saved Earth from Judgment Day, and he''s now living under the radar, steering clear of using anything Skynet can trace. That is, until he encounters T-X, a robotic assassin ordered to finish what T-1000 started. Good thing Connor''s former nemesis, the Terminator, is back to aid the now-adult Connor … just like he promised.', CAST(N'2003-07-02' AS Date), 109, 296, N'tt0181852', N'/lz4xYdF1n09lyiCfZWtWT44SZiG.jpg', N'/tMhvihszpLbOjj7mJSTW7bgQbIc.jpg', CAST(N'2017-11-09T23:41:29.510' AS DateTime))
