INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (133, N'Untitled Terminator Reboot', N'Plot unknown.', CAST(N'2019-07-26' AS Date), 0, 290859, N'tt6450804', N'', N'', CAST(N'2017-11-09T23:41:30.663' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (134, N'Amanda & Jack Go Glamping', N'With his marriage and career against the ropes, dejected author Jack Spencer travels with his wife, Amanda, to an isolated glamping retreat in search of a spark. When a surprise double booking finds their private retreat anything but private, Jack spins into a comedic exploration of love, lost dreams, small-town-wisdom, and friendship with a miniature donkey to get over himself before he loses all he holds dear.', CAST(N'2017-11-10' AS Date), 94, 466421, N'tt5578150', N'/vPxTTihrmjnXw88f1hjHoerE2RG.jpg', N'/qqaq7Pjy3ZnvRrzjDuHCgO5GXH5.jpg', CAST(N'2017-11-09T23:41:31.837' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (135, N'The Hobbit: The Battle of the Five Armies', N'Immediately after the events of The Desolation of Smaug, Bilbo and the dwarves try to defend Erebor''s mountain of treasure from others who claim it: the men of the ruined Laketown and the elves of Mirkwood. Meanwhile an army of Orcs led by Azog the Defiler is marching on Erebor, fueled by the rise of the dark lord Sauron. Dwarves, elves and men must unite, and the hope for Middle-Earth falls into Bilbo''s hands.', CAST(N'2014-12-10' AS Date), 144, 122917, N'tt2310332', N'/9zRzFJuaj0CHIOhAkcCcFTvyu2X.jpg', N'/9tgt63Gk2C0Pu5Q8fkVO1TZuqW9.jpg', CAST(N'2017-11-09T23:41:32.183' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (136, N'The Hobbit: An Unexpected Journey', N'Bilbo Baggins, a hobbit enjoying his quiet life, is swept into an epic quest by Gandalf the Grey and thirteen dwarves who seek to reclaim their mountain home from Smaug, the dragon.', CAST(N'2012-11-26' AS Date), 169, 49051, N'tt0903624', N'/ysX7vDmSh5O19vFjAi56WL7l4nk.jpg', N'/jjAq3tCezdlQduusgtMhpY2XzW0.jpg', CAST(N'2017-11-09T23:41:32.997' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (137, N'The Hobbit: The Desolation of Smaug', N'The Dwarves, Bilbo and Gandalf have successfully escaped the Misty Mountains, and Bilbo has gained the One Ring. They all continue their journey to get their gold back from the Dragon, Smaug.', CAST(N'2013-12-11' AS Date), 161, 57158, N'tt1170358', N'/gQCiuxGsfiXH1su6lp9n0nd0UeH.jpg', N'/hyR7Fs6Tepgu3yCQGtgO4Ilz9tY.jpg', CAST(N'2017-11-09T23:41:33.570' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (138, N'The Lord of the Rings: The Fellowship of the Ring', N'Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.', CAST(N'2001-12-18' AS Date), 178, 120, N'tt0120737', N'/bxVxZb5O9OxCO0oRUNdCnpy9NST.jpg', N'/pIUvQ9Ed35wlWhY2oU6OmwEsmzG.jpg', CAST(N'2017-11-09T23:41:34.557' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (139, N'The Lord of the Rings: The Two Towers', N'Frodo and Sam are trekking to Mordor to destroy the One Ring of Power while Gimli, Legolas and Aragorn search for the orc-captured Merry and Pippin. All along, nefarious wizard Saruman awaits the Fellowship members at the Orthanc Tower in Isengard.', CAST(N'2002-12-18' AS Date), 179, 121, N'tt0167261', N'/wf3v0Pn09jnT5HSaYal7Ami3bdA.jpg', N'/dG4BmM32XJmKiwopLDQmvXEhuHB.jpg', CAST(N'2017-11-09T23:41:34.870' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (140, N'The Lord of the Rings: The Return of the King', N'Aragorn is revealed as the heir to the ancient kings as he, Gandalf and the other members of the broken fellowship struggle to save Gondor from Sauron''s forces. Meanwhile, Frodo and Sam bring the ring closer to the heart of Mordor, the dark lord''s realm.', CAST(N'2003-12-01' AS Date), 201, 122, N'tt0167260', N'/uexxR7Kw1qYbZk0RYaF9Rx5ykbj.jpg', N'/8BPZO0Bf8TeAy8znF43z8soK3ys.jpg', CAST(N'2017-11-09T23:41:35.433' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (141, N'Science Fiction Volume One: The Osiris Child', N'Set in the future in a time of interplanetary colonization, an unlikely pair race against an impending global crisis and are confronted by the monsters that live inside us all.', CAST(N'2017-08-31' AS Date), 95, 354282, N'tt4536768', N'/3sx69bH2n2tgvknvq2VROJ6lEXS.jpg', N'/5HlTix2YQw24NCGZ7D83VJeRkLh.jpg', CAST(N'2017-11-09T23:41:36.400' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (142, N'Intent to Destroy: Death, Denial & Depiction', N'INTENT TO DESTROY embeds with a historic feature production as a springboard to explore the violent history of the Armenian Genocide and legacy of Turkish suppression and denial over the past century.', CAST(N'2017-11-10' AS Date), 115, 452509, N'tt6794462', N'/5QnLcyfYP1xYr398UNXjaudRPk8.jpg', N'', CAST(N'2017-11-09T23:41:36.757' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (143, N'A Bad Moms Christmas', N'In this comedy a few  titular under-appreciated and over-burdened friends cope with the stresses of the most wonderful time of year as their own mothers visit for the holidays.', CAST(N'2017-11-03' AS Date), 104, 431530, N'tt6359956', N'/gPNHolu7AGnrB7r5kvJRRTfwMFR.jpg', N'/oR4u6ZlLx0nVUuq1OfYKuwVhtkg.jpg', CAST(N'2017-11-09T23:41:37.117' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (144, N'Spirited Away', N'A young girl, Chihiro, becomes trapped in a strange new world of spirits. When her parents undergo a mysterious transformation, she must call upon the courage she never knew she had to free her family.', CAST(N'2001-07-20' AS Date), 125, 129, N'tt0245429', N'/dL11DBPcRhWWnJcFXl9A07MrqTI.jpg', N'/mnpRKVSXBX6jb56nabvmGKA0Wig.jpg', CAST(N'2017-11-09T23:41:37.473' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (145, N'Doctor Strange', N'After his career is destroyed, a brilliant but arrogant surgeon gets a new lease on life when a sorcerer takes him under his wing and trains him to defend the world against evil.', CAST(N'2016-10-25' AS Date), 115, 284052, N'tt1211837', N'/4PiiNGXj1KENTmCBHeN6Mskj2Fq.jpg', N'/tFI8VLMgSTTU38i8TIsklfqS9Nl.jpg', CAST(N'2017-11-09T23:41:37.843' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (146, N'Captain America: Civil War', N'Following the events of Age of Ultron, the collective governments of the world pass an act designed to regulate all superhuman activity. This polarizes opinion amongst the Avengers, causing two factions to side with Iron Man or Captain America, which causes an epic battle between former allies.', CAST(N'2016-04-27' AS Date), 147, 271110, N'tt3498820', N'/kSBXou5Ac7vEqKd97wotJumyJvU.jpg', N'/m5O3SZvQ6EgD5XXXLPIP1wLppeW.jpg', CAST(N'2017-11-09T23:41:38.217' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (147, N'Captain America: The Winter Soldier', N'After the cataclysmic events in New York with The Avengers, Steve Rogers, aka Captain America is living quietly in Washington, D.C. and trying to adjust to the modern world. But when a S.H.I.E.L.D. colleague comes under attack, Steve becomes embroiled in a web of intrigue that threatens to put the world at risk. Joining forces with the Black Widow, Captain America struggles to expose the ever-widening conspiracy while fighting off professional assassins sent to silence him at every turn. When the full scope of the villainous plot is revealed, Captain America and the Black Widow enlist the help of a new ally, the Falcon. However, they soon find themselves up against an unexpected and formidable enemy—the Winter Soldier.', CAST(N'2014-03-20' AS Date), 136, 100402, N'tt1843866', N'/5TQ6YDmymBpnF005OyoB7ohZps9.jpg', N'/4qfXT9BtxeFuamR4F49m2mpKQI1.jpg', CAST(N'2017-11-09T23:41:39.050' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (148, N'Captain America: The First Avenger', N'Predominantly set during World War II, Steve Rogers is a sickly man from Brooklyn who''s transformed into super-soldier Captain America to aid in the war effort. Rogers must stop the Red Skull – Adolf Hitler''s ruthless head of weaponry, and the leader of an organization that intends to use a mysterious device of untold powers for world domination.', CAST(N'2011-07-22' AS Date), 124, 1771, N'tt0458339', N'/vSNxAJTlD0r02V9sPYpOjqDZXUK.jpg', N'/pmZtj1FKvQqISS6iQbkiLg5TAsr.jpg', CAST(N'2017-11-09T23:41:39.643' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (149, N'Life Is Beautiful', N'A touching story of an Italian book seller of Jewish ancestry who lives in his own little fairy tale. His creative and happy life would come to an abrupt halt when his entire family is deported to a concentration camp during World War II. While locked up he tries to convince his son that the whole thing is just a game.', CAST(N'1997-12-20' AS Date), 116, 637, N'tt0118799', N'/f7DImXDebOs148U4uPjI61iDvaK.jpg', N'/bORe0eI72D874TMawOOFvqWS6Xe.jpg', CAST(N'2017-11-09T23:41:40.643' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (150, N'Annabelle: Creation', N'Several years after the tragic death of their little girl, a dollmaker and his wife welcome a nun and several girls from a shuttered orphanage into their home, soon becoming the target of the dollmaker''s possessed creation, Annabelle.', CAST(N'2017-08-03' AS Date), 109, 396422, N'tt5140878', N'/tb86j8jVCVsdZnzf8I6cIi65IeM.jpg', N'/o8u0NyEigCEaZHBdCYTRfXR8U4i.jpg', CAST(N'2017-11-09T23:41:40.993' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (151, N'Annabelle', N'John Form has found the perfect gift for his expectant wife, Mia - a beautiful, rare vintage doll in a pure white wedding dress. But Mia''s delight with Annabelle doesn''t last long. On one horrific night, their home is invaded by members of a satanic cult, who violently attack the couple. Spilled blood and terror are not all they leave behind. The cultists have conjured an entity so malevolent that nothing they did will compare to the sinister conduit to the damned that is now... Annabelle.', CAST(N'2014-10-02' AS Date), 99, 250546, N'tt3322940', N'/yAgxM61Sn0dYML4C9v3MJFp5zPI.jpg', N'/8pCFurneAWouGbBMEoBHqU1ejbb.jpg', CAST(N'2017-11-09T23:41:41.310' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (152, N'The Star', N'A small but brave donkey and his animal friends become the unsung heroes of the greatest story ever told, the first Christmas.', CAST(N'2017-11-15' AS Date), 0, 355547, N'tt4587656', N'/tEbDvivUfsCupngKIfMJJ725eAD.jpg', N'/iJ5dkwIHQnq8dfmwSLh7dpETNhi.jpg', CAST(N'2017-11-09T23:41:42.293' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (153, N'Alien: Covenant', N'Bound for a remote planet on the far side of the galaxy, the crew of the colony ship ''Covenant'' discovers what is thought to be an uncharted paradise, but is actually a dark, dangerous world – which has its sole inhabitant the ''synthetic'', David, survivor of the doomed Prometheus expedition.', CAST(N'2017-05-09' AS Date), 122, 126889, N'tt2316204', N'/zecMELPbU5YMQpC81Z8ImaaXuf9.jpg', N'/kMU8trT43p5LFoJ4plIySMOsZ1T.jpg', CAST(N'2017-11-09T23:41:42.667' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (154, N'Prometheus', N'A team of explorers discover a clue to the origins of mankind on Earth, leading them on a journey to the darkest corners of the universe. There, they must fight a terrifying battle to save the future of the human race.', CAST(N'2012-05-30' AS Date), 124, 70981, N'tt1446714', N'/ng8ALjSDhUmwLl7vtjUWIZNQSlt.jpg', N'/rRhoMIqgdX9wEtRUOLsqXKkH9I0.jpg', CAST(N'2017-11-09T23:41:42.967' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (155, N'Arrival', N'Taking place after alien crafts land around the world, an expert linguist is recruited by the military to determine whether they come in peace or are a threat.', CAST(N'2016-11-10' AS Date), 113, 329865, N'tt2543164', N'/hLudzvGfpi6JlwUnsNhXwKKg4j.jpg', N'/yIZ1xendyqKvY3FGeeUYUd5X9Mm.jpg', CAST(N'2017-11-09T23:41:43.933' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (156, N'Wonder', N'Based on the New York Times bestseller, Wonder tells the inspiring and heartwarming story of August Pullman. Born with facial differences that, up until now, have prevented him from going to a mainstream school, Auggie becomes the most unlikely of heroes when he enters the local fifth grade. As his family, his new classmates, and the larger community all struggle to find their compassion and acceptance, Auggie''s extraordinary journey will unite them all and prove you can''t blend in when you were born to stand out.', CAST(N'2017-11-16' AS Date), 113, 406997, N'tt2543472', N'/iWjUKwPJ91nFoltlZzr8s4Ij5da.jpg', N'/f1Jv532UM9j6zrV2XVkHL7HyyIW.jpg', CAST(N'2017-11-09T23:41:44.300' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (157, N'Call Me by Your Name', N'Elio Perlman is spending the summer with his family at their vacation home in Lombardy, Italy. When his father hires a handsome doctoral student, the curious 17-year-old finds himself developing a growing attraction to the young man.', CAST(N'2017-10-27' AS Date), 130, 398818, N'tt5726616', N'/tcNniniS4rfqrLH0oORikJfnIwY.jpg', N'/8ndqvvwDVe9oDUQF1Jt6NCjAn7z.jpg', CAST(N'2017-11-09T23:41:44.653' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (158, N'The Fate of the Furious', N'When a mysterious woman seduces Dom into the world of crime and a betrayal of those closest to him, the crew face trials that will test them as never before.', CAST(N'2017-04-12' AS Date), 136, 337339, N'tt4630562', N'/zHdzzKwJjrMwSoy6ab4rI8siwPe.jpg', N'/jzdnhRhG0dsuYorwvSqPqqnM1cV.jpg', CAST(N'2017-11-09T23:41:45.020' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (159, N'2 Fast 2 Furious', N'It''s a major double-cross when former police officer Brian O''Conner teams up with his ex-con buddy Roman Pearce to transport a shipment of "dirty" money for shady Miami-based import-export dealer Carter Verone. But the guys are actually working with undercover agent Monica Fuentes to bring Verone down.', CAST(N'2003-06-05' AS Date), 107, 584, N'tt0322259', N'/hZVcmztCVo510FhBXyLqStiTAce.jpg', N'/8RkLHFm2PK4PO5W0WZA5LMXLZBz.jpg', CAST(N'2017-11-09T23:41:45.340' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (160, N'The Fast and the Furious: Tokyo Drift', N'In order to avoid a jail sentence, Sean Boswell heads to Tokyo to live with his military father. In a low-rent section of the city, Shaun gets caught up in the underground world of drift racing', CAST(N'2006-06-03' AS Date), 104, 9615, N'tt0463985', N'/f9V0iTSYwnxW6tPIjSE7jrGC7eP.jpg', N'/kOZbGxeGMJ4Y6bxv8eOadFt8QLF.jpg', CAST(N'2017-11-09T23:41:45.910' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (161, N'The Fast and the Furious', N'Domenic Toretto is a Los Angeles street racer suspected of masterminding a series of big-rig hijackings. When undercover cop Brian O''Conner infiltrates Toretto''s iconoclastic crew, he falls for Toretto''s sister and must choose a side: the gang or the LAPD.', CAST(N'2001-06-22' AS Date), 106, 9799, N'tt0232500', N'/x4So4OkqnjfOSBCCNd5uosMmQiB.jpg', N'/lmIqH8Qsv3IvDg0PTFUuVr89eBT.jpg', CAST(N'2017-11-09T23:41:46.487' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (162, N'Fast Five', N'Former cop Brian O''Conner partners with ex-con Dom Toretto on the opposite side of the law. Since Brian and Mia Toretto broke Dom out of custody, they''ve blown across many borders to elude authorities. Now backed into a corner in Rio de Janeiro, they must pull one last job in order to gain their freedom.', CAST(N'2011-04-20' AS Date), 130, 51497, N'tt1596343', N'/cA81CI8odKv5KHRUUzJbj83yN7c.jpg', N'/nL1Q0micYpF5nNkaI2ZNeLuOLGZ.jpg', CAST(N'2017-11-09T23:41:47.053' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (163, N'Fast & Furious 6', N'Hobbs has Dominic and Brian reassemble their crew to take down a team of mercenaries: Dominic unexpectedly gets convoluted also facing his presumed deceased girlfriend, Letty.', CAST(N'2013-05-06' AS Date), 130, 82992, N'tt1905041', N'/b9gTJKLdSbwcQRKzmqMq3dMfRwI.jpg', N'/qjfE7SkPXpqFs8FX8rIaG6eO2aK.jpg', CAST(N'2017-11-09T23:41:47.617' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (164, N'Furious 7', N'Deckard Shaw seeks revenge against Dominic Toretto and his family for his comatose brother.', CAST(N'2015-04-01' AS Date), 137, 168259, N'tt2820852', N'/dCgm7efXDmiABSdWDHBDBx2jwmn.jpg', N'/ypyeMfKydpyuuTMdp36rMlkGDUL.jpg', CAST(N'2017-11-09T23:41:48.200' AS DateTime))
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path], [Date_Updated]) VALUES (165, N'Fast & Furious', N'When a crime brings them back to L.A., fugitive ex-con Dom Toretto reignites his feud with agent Brian O''Conner. But as they are forced to confront a shared enemy, Dom and Brian must give in to an uncertain new trust if they hope to outmaneuver him. And the two men will find the best way to get revenge: push the limits of what''s possible behind the wheel.', CAST(N'2009-04-02' AS Date), 107, 13804, N'tt1013752', N'/ft8IqAGFs3V7i87z0t0EVRUjK1p.jpg', N'/1R2ihQztuRTIqN3pFBR1yrBMd7w.jpg', CAST(N'2017-11-09T23:41:48.773' AS DateTime))
